import styled from 'styled-components';
import Paper from '@material-ui/core/Paper';

export const CategoryTitle = styled.div`
    text-align: center;
    background-color: #efefef;
    margin: 10px;
    padding: 5px;
    font-size: 24px;
    font-family: monospace;
    border-radius: 5px;
`;

export const CategoryWrapper = styled(Paper)`
    margin-right: 10px;
    padding: 10px;
`;
